let currentChishiki = '';
function _1666105200_dispMenu(){
  if(document.getElementById('chishikiMenu').innerHTML === ''){
    _1666105200_load();
  }else{
    document.getElementById('chishikiMenu').classList.toggle('hidden');
  }
}
function _1666105200_load(){
  const data = chishiki_list;
  for(var i=0; i<data.length; i++){
    var html = "<li><div style='cursor:pointer;' onclick=kamokuOpen('kamoku" + i + "')>▼" + data[i].kamoku + "</div><div id=kamoku" + i + " style='display:none;'><ul style='list-style-type:none;padding:0 0 0 5px; margin:0;'>";
    for (var j = 0; j < data[i].categories.length; j++) {
      html += "<li><div style='cursor:pointer;' onclick=kamokuCategoryOpen('kamoku" + i + "'," + "'category" + j + "')>▽" + data[i].categories[j].category + "</div><div class=category" + j + " style='display:none;'><ul style='list-style-type:none;padding:0 0 0 5px; margin:0;'>";
      for (var k = 0; k < data[i].categories[j].chishikis.length; k++) {
        if(data[i].categories[j].chishikis[k].hatten_flg == "★"){
          html += "<li style='color:#edbb00;'><span onclick=_1666105200_dispChishiki('" + data[i].categories[j].chishikis[k].chishiki_id + "')>"
                + data[i].categories[j].chishikis[k].chishiki_nm
                + '</span></li>'
        }else{
          html += "<li><span onclick=_1666105200_dispChishiki('" + data[i].categories[j].chishikis[k].chishiki_id + "')>"
                + data[i].categories[j].chishikis[k].chishiki_nm
                + '</span></li>'
        }
      }
      html += "</ul></div></li>";
    }
    html += "</ul></div></li>";
    document.getElementById('chishikiMenu').innerHTML += html;
  }
}
function kamokuOpen(id){
  obj=document.getElementById(id).style;
  obj.display=(obj.display=='none')?'block':'none';
}
function kamokuCategoryOpen(id,classNm){
  var o = document.getElementById(id);
  var obj = o.getElementsByClassName(classNm)[0].style;
  obj.display=(obj.display=='none')?'block':'none';
}
function _1666105200_dispChishiki(id){
  document.getElementById('chishikiMenu').classList.add('hidden');
  document.getElementById('chishikiImg').classList.remove('hidden');
  document.getElementById('chishikiAudio').removeAttribute('controls');
  document.getElementById('chishikiImg').src = '';
  document.getElementById('chishikiAudio').src = '';
  document.getElementById('chishikiRev').classList.remove('hidden');
  document.getElementById('chishikiFwd').classList.remove('hidden');
  try{
    document.getElementById('chishikiImg').src = 'https://pos.toshin.com/TGT/OPCTTS/Basic100/contents/image/' + arrChishikiMst[id].PNG_FILE_NM;
    if(arrChishikiMst[id].SOUND_FILE_NM !== ''){
      document.getElementById('chishikiAudio').src = 'https://pos.toshin.com/TGT/OPCTTS/Basic100/contents/sound/' + arrChishikiMst[id].SOUND_FILE_NM;
      document.getElementById('chishikiAudio').setAttribute('controls',true);
    }
    currentChishiki = id;
    document.getElementById('currentChishiki_Monitor').textContent = ' CONTENTS_ID : ' + id + ' (' + ((Object.keys(arrChishikiMst)).indexOf(currentChishiki)+1) + ' / ' + Object.keys(arrChishikiMst).length + ')';
  }catch(e){
    alert('* ERROR *\n id"' + id + '" is not defined.')
  }
}
function _1666105200_dispRev(){
  if((Object.keys(arrChishikiMst)).indexOf(currentChishiki) > 0){
    _1666105200_dispChishiki(Object.keys(arrChishikiMst)[Object.keys(arrChishikiMst).indexOf(currentChishiki)-1]);
  }else{
    _1666105200_dispChishiki(Object.keys(arrChishikiMst)[Object.keys(arrChishikiMst).length-1]);
  }
}
function _1666105200_dispFwd(){
  if((Object.keys(arrChishikiMst)).indexOf(currentChishiki) !== Object.keys(arrChishikiMst).length-1){
    _1666105200_dispChishiki(Object.keys(arrChishikiMst)[Object.keys(arrChishikiMst).indexOf(currentChishiki)+1]);
  }else{
    _1666105200_dispChishiki(Object.keys(arrChishikiMst)[0]);
  }
}
